impl<'a, K: Hash + Eq, V> Drop for FrameDrain<'a, K, V> {
  fn drop(&mut self) {
    while self.next().is_some() {}

    if self.size > 0 {
      log::info!(
        "Frame[{}]: cache hit percent is {:.1}%",
        self.label,
        self.cache.len() as f32 / self.size as f32
      );
    }
  }
}
